def lengthOfLongestSubstring(s: 'str'):
    max =0
    map = []
    for i in range(len(s)):

        if s[i] in map:
            if len(map) >max:
                max = len(map)
            map = map[map.index(s[i])+1:i]
            map.append(s[i])

        else:
            map.append(s[i])

    return len(map) if len(map) > max else max




